+ static void registry_global(void *data, struct wl_registry *wl_registry, uint32_t name, const char *interface, uint32_t version) 现在，每一帧中，我们将： 销毁现在使用的帧回调 为下一帧请求一个新的回调 渲染并提交新的帧 第三步细分为： 用一个新的偏移量来更新，使用同上一帧一致的速度滚动。 准备一个新的 wl_buffer 并为其渲染一帧。 将新的 wl_buffer 附加到我们的表面。 将整个表面标记为 “损坏”。 提交表面。 步骤 3 和 4 更新表面的待定状态，为其赋予一个新的缓冲区，并表示整个表面状态已经改变。第 5 步提交这个待定状态，并在下一帧中使用它。原子化应用这个新的缓冲区意味着我们永远不会只显示最后帧的一半，从而产生一个更好的无撕裂体验。编译并运行更新后的客户端，亲身体验一下吧。 想要更准确的描述吗？在第 12.1 章中我们谈到了一个扩展协议，它能以纳秒级的分辨率告诉你每一帧画面是何时呈现给用户的。
